import axios from "axios";
import React, { useEffect, useState } from "react";

const PopularMoviesContainer = () => {
  const [movies, setMovies] = useState({});

  useEffect(() => {
    axios.get("/popular").then((data) => {
      console.log(data);
      setMovies(data);
    });
  }, []);

  return <SingleMovie />;
};

export default PopularMoviesContainer;
